import {Link} from 'react-router-dom';

function Navbar() {
  return (
    <div>
      <Link to="/" state={{ data: cinemaMovies }}> Home</Link>
      <Link to="/cinema">Cinema</Link>
    </div>
  )
}

export default Navbar;
